// @flow strict

// Components
import { PokemonArchive } from '../components/PokemonArchive';

// Page
const Page = ({ pokemon }: Props) => {
	return (
		<React.Fragment>
			<PokemonArchive pokemon={pokemon} />
		</React.Fragment>
	)
}

// Props
Page.getInitialProps = async function() {
	const pokemon = await fetch('https://pokeapi.co/api/v2/pokemon')
		.then(res => res.json());

	return { pokemon };
}

// Export
export default Page;
